import React, { useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { addItem, removeItem } from './CartSlice';

const Cart = () => { 
  const itemsInCart = useSelector((state) => state.cart.items);
  const totalPrice = useSelector((state) => state.cart.totalPrice);
  const dispatch = useDispatch();

  
  const [catalog] = useState([
    { id: '1', name: 'Product 1', price: 250, imageUrl: 'data:image/jpeg;base64,' },
    { id: '2', name: 'Product 2', price: 500, imageUrl: 'data:image/jpeg;base64,' },
    { id: '3', name: 'Product 3', price: 1000, imageUrl: 'data:image/jpeg;base64,' },
    { id: '4', name: 'Product 4', price: 7500, imageUrl: 'data:image/jpeg;base64,' },
    { id: '2', name: 'Product 5', price: 3500, imageUrl: 'data:image/jpeg;base64,' },
   { id: '2', name: 'Product 6', price: 1500, imageUrl: 'data:image/jpeg;base64,' },
   
  ]);

  // Function to add items to the cart
  const handleAddToCart = (item) => {
    dispatch(addItem(item));
  };

  return (
    <div style={{ display: 'flex', justifyContent: 'space-between' }}>
      {/* Product Catalog Section */}
      <div style={{ width: '50%', padding: '10px' }}>
        <h2>Product Catalog</h2>
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
          {catalog.map((product) => (
            <div key={product.id} style={{ border: '1px solid #ccc', padding: '10px', width: '200px' }}>
              <img
                src={product.imageUrl}
                alt={product.name}
                style={{ width: '150px', height: '150px', objectFit: 'cover' }}
              />
              <h4>{product.name}</h4>
              <p>Price: ${product.price}</p>
              <button onClick={() => handleAddToCart(product)}>Add to Cart</button>
            </div>
          ))}
        </div>
      </div>

      {/* Cart Section */}
      <div style={{ width: '40%', padding: '10px', border: '1px solid', borderRadius: '8px' }}>
        <h2> Cart</h2>
        {itemsInCart.length > 0 ? (
          <div>
            <ul>
              {itemsInCart.map((item) => (
                <li key={item.id} style={{ marginBottom: '10px' }}>
                  <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
                    <div>
                      <h4>{item.name}</h4>
                      <p>Price: ${item.price}</p>
                    </div>
                    <button onClick={() => dispatch(removeItem(item))}>Remove</button>
                  </div>
                </li>
              ))}
            </ul>
            <h3>Total Price: ${totalPrice}</h3>
          </div>
        ) : (
          <p>cart is empty.</p>
        )}
      </div>
    </div>
  );
};

export default Cart;